in()
{
	int B, i, s, lim, res, cnt, ans;
	int lb, mi, ub, t1, t2;

	while (N = in()) {
		M = in(), B = in();
		for (i = 0; i < N; i++) ax[i] = in(), ay[i] = in();
		for (i = 0; i < M; i++) bx[i] = in(), by[i] = in(), c[i] = in(), f[i] = in();

		source = N + M, sink = source + 1, V = sink + 1;

		ans = INF, lim = 1 << M;
	    for (s = 0; s < lim; s++) {
			res = 0, cnt = 0;
			for (i = 0; i < M; i++) if ((1<<i) & s) res += f[i], cnt++;
			lb = 0, ub = 4001;
			while (1) {
				if (lb + 1 >= ub) {
					res += calc(s, lb) + lb*B*cnt;
					if (ans > res) ans = res;
					break;
				}
				mi = (lb + ub) >> 1;
				if ((t1 = calc(s, mi  ) + mi*B*cnt)     < 0) break;
				if ((t2 = calc(s, mi-1) + (mi-1)*B*cnt) < 0) break;
				if (t1 < t2) lb = mi; else ub = mi;
			}
		}
		printf("%d\n", ans);
	}
	return 0;
}
